+import 'package:flutter/services.dart';
+
+class VolumeController {
+  static const MethodChannel _channel = MethodChannel('com.example.volume');
+
+  VolumeController() {
+    _channel.setMethodCallHandler((MethodCall call) async {
+      if (call.method == 'volumeChanged') {
+        int volume = call.arguments;
+        // Handle volume change
+        print('Volume changed: $volume');
+      }
+    });
+  }
+
+  Future<int> getVolume() async {
+    try {
+      final int volume = await _channel.invokeMethod('getMediaVolume');
+      return volume;
+    } catch (e) {
+      print("Failed to get volume: '${e.toString()}'");
+      return -1;
+    }
+  }
+
+  void listenForVolumeChanges(Function(int) onVolumeChanged) {
+    _channel.setMethodCallHandler((MethodCall call) async {
+      if (call.method == 'volumeChanged') {
+        final int volume = call.arguments as int;
+        onVolumeChanged(volume);
+      }
+    });
+  }
+
+  Future<void> setMediaVolume(int percentage) async {
+    try {
+      print("Attempting to set media volume to $percentage%");
+      await _channel.invokeMethod('setMediaVolume', {'percentage': percentage});
+      print("Volume set request sent successfully.");
+    } on PlatformException catch (e) {
+      print("Failed to set volume: '${e.message}'.");
+    }
+    catch (e) {
+      print("An unexpected error occurred in setMediaVolume: ${e.toString()}");
+    }
+  }
+}
